import ProductSlider from "./ProductSlider"
import ProductInfo from "./ProductInfo"
import ProductLiner from "./ProductLiner"

const ProductItem = () => {
    return (
        <>
            <ProductSlider />
            <ProductInfo />
            <ProductLiner />
        </>
    )
}

export default ProductItem;
